import Input from './Input';

interface FormInputProps {
  label: string;
  type?: string;
}

const FormInput: React.FC<FormInputProps> = ({ label, type = 'text', ...props }) => (
  <Input label={label} type={type} {...props} />
);

export default FormInput;
